contracts/TransactionProcessing.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity 0.8.17;
import "./KYC.sol";
import "./AML.sol";

contract TransactionProcessing{
    event CreateLog(string firstName, uint256 timestamp);
    event CreateAMLLog(bool amlResult, uint256 timestamp);

    address payable public sender;
    address payable public receiver;
    address public kycAddress; 
    KYC public kyc; 
    AML public aml;

    constructor(address payable _receiver, address _kycAddress, address _amlAddress) payable {
        require(_receiver != address(0), "receiver = zero address");
        sender = payable(msg.sender);
        receiver = _receiver;
        kycAddress = _kycAddress;
        kyc = KYC(_kycAddress); 
        aml = AML(_amlAddress);
    }

    function processing() public {
        
        // Check sender and receiver for suspicious activity 
        //KYC - get sender nationality
        string memory nationality = kyc.getUserInfo(sender).nationality;
        emit CreateLog(nationality, block.timestamp);

        // check sender AML
        bool senderAmlResult = aml.checkNationality(nationality);
        emit CreateAMLLog(senderAmlResult, block.timestamp);


    }

    function sendViaCall() public payable {
        // Call returns a boolean value indicating success or failure.
        // This is the current recommended method to use.
        (bool sent, bytes memory data) = receiver.call{value: getBalance()}("");
        require(sent, "Failed to send Ether");
    }

    function getBalance() public view returns (uint) {
        return address(this).balance;
    }
}

contracts/AML.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity 0.8.17;

contract AML{

    string[] bannedCountries;

    function checkNationality(string memory userNationality) public returns(bool){

        bannedCountries.push("Iran");
        bannedCountries.push("Afganistan");
        bannedCountries.push("Turkmenistan");
        bannedCountries.push("Kyrgyzstan");


        //check if userNationality in bannedCountries
        for (uint i = 0; i < bannedCountries.length; i++) {
            if (keccak256(abi.encodePacked(bannedCountries[i])) == keccak256(abi.encodePacked(userNationality))) {
            return true;
            }
        }

        return false;

    }
}

